import React from 'react';
import './Person.css';

const person = (props) => {
    return (
        <div className="Person" onClick={props.click}>
            <p> {props.name} is {props.age}  {props.children} </p>
            <input type="text" onChange={props.change} value={props.name}/>
        </div>

    );
}

export default person;
